Ext
		.define(
				'ImageProcessor.view.Main',
				{
					extend : 'Ext.tab.Panel',
					xtype : 'main',
					requires : ['Ext.TitleBar', 'Ext.Img', 'Ext.Ajax'],
					config : {
						tabBarPosition : 'bottom',

						items : [{
							title : 'Images',
							iconCls : 'home',

							styleHtmlContent : true,
							scrollable : true,

							items : [
									{
										docked : 'top',
										xtype : 'titlebar',
										title : 'Image Processor'
									},
									{
										html : "<img width='300px' height='300px' src='data:image/jpeg;base64,'/>",
									},
									{
										html : "<img id='gray_image' width='300px' height='300px' src=''/>",
									}, {
										xtype : 'button',
										text : 'Transform',
										action : 'ui',
										width : '185px',
										listeners : {
											tap : function() {
												Ext.Ajax.request({
												    url: 'http://' + window.location.host + '/grayfilters',
												    headers: {'Content-Type' : 'application/json' },
												    method: 'POST',
												    jsonData: '{"id": "null", "base64String": ""}',
												    success: function(response){
												    	console.log(response.responseText);
												        var base64String = response.responseText;
												        Ext.get('gray_image').dom.src = 'data:image/jpeg;base64,' + base64String;
												    }
												});
											}
										}

									}]
						}]
					},

				});
